hatchery:
  enabled: true
  image:
    repository: 707767160287.dkr.ecr.us-east-1.amazonaws.com/gen3/hatchery
    tag: '2025.05'
  hatchery:
    json: |-
      {
        "user-namespace": "jupyter-pods",
        "sub-dir": "/lw-workspace",
        "user-volume-size": "10Gi",
        "sidecar": {
          "cpu-limit": "1.0",
          "memory-limit": "256Mi",
          "image": "707767160287.dkr.ecr.us-east-1.amazonaws.com/gen3/gen3fuse-sidecar:2025.05",
          "env": {
            "NAMESPACE": "default",
            "HOSTNAME": "jcoin.datacommons.io"
          },
          "args": [],
          "command": [
            "/bin/bash",
            "/sidecarDockerrun.sh"
          ],
          "lifecycle-pre-stop": [
            "su",
            "-c",
            "echo test",
            "-s",
            "/bin/sh",
            "root"
          ]
        },
        "containers": [
          {
            "target-port": 8888,
            "cpu-limit": "1.0",
            "memory-limit": "2Gi",
            "name": "(Generic) Jupyter Lab Notebook with R Kernel",
            "image": "quay.io/cdis/heal-notebooks:generic_rkernel__ff880f355bfcfbb1b1a8c6e4615e13152c71be2b",
            "env": {
              "FRAME_ANCESTORS": "https://jcoin.datacommons.io"
            },
            "args": [
              "--JupyterNotebookApp.base_url=/lw-workspace/proxy/",
              "--JupyterNotebookApp.default_url=/lab",
              "--JupyterNotebookApp.password=''",
              "--JupyterNotebookApp.token=''",
              "--JupyterNotebookApp.ip='*'",
              "--JupyterNotebookApp.notebook_dir='/home/jovyan'",
              "--JupyterNotebookApp.shutdown_no_activity_timeout=5400",
              "--JupyterNotebookApp.quit_button=False"
            ],
            "command": [
              "start-notebook.sh"
            ],
            "path-rewrite": "/lw-workspace/proxy/",
            "use-tls": "false",
            "ready-probe": "/lw-workspace/proxy/",
            "lifecycle-post-start": [
              "/bin/sh",
              "-c",
              "export IAM=`whoami`; rm -rf /home/$IAM/pd/dockerHome; rm -rf /home/$IAM/pd/lost+found; ln -s /data /home/$IAM/pd/; true"
            ],
            "user-uid": 1000,
            "fs-gid": 100,
            "user-volume-location": "/home/jovyan/pd",
            "gen3-volume-location": "/home/jovyan/.gen3"
          },
          {
            "target-port": 8888,
            "cpu-limit": "1.0",
            "memory-limit": "2Gi",
            "name": "User-licensed Stata Notebook",
            "image": "quay.io/cdis/stata-heal:master",
            "env": {
              "FRAME_ANCESTORS": "https://jcoin.datacommons.io"
            },
            "args": [
              "--NotebookApp.base_url=/lw-workspace/proxy/",
              "--NotebookApp.password=''",
              "--NotebookApp.token=''",
              "--NotebookApp.shutdown_no_activity_timeout=5400",
              "--NotebookApp.quit_button=False"
            ],
            "command": [
              "start-notebook.sh"
            ],
            "path-rewrite": "/lw-workspace/proxy/",
            "use-tls": "false",
            "ready-probe": "/lw-workspace/proxy/",
            "lifecycle-post-start": [
              "/bin/sh",
              "-c",
              "(while true; do [ -d ~/pd ] && [ -f ~/pd/stata.lic ] && cp ~/pd/stata.lic /usr/local/stata17/; sleep 1; done) & export IAM=`whoami`; rm -rf /home/$IAM/pd/dockerHome; rm -rf /home/$IAM/pd/lost+found; ln -s /data /home/$IAM/pd/; true"
            ],
            "user-uid": 1000,
            "fs-gid": 100,
            "user-volume-location": "/home/jovyan/pd",
            "gen3-volume-location": "/home/jovyan/.gen3"
          }
        ]
      }
